import React from 'react'
import styles from './styles.module.scss';

const GeneralStats = () => {
  return (
    <>
      <h2 className={styles.generalStatsTitle}>General STATS</h2>
      <div className={styles.generalStats}>
        <div className={styles.generalStatsData}>
          <h4 className={styles.statsDataEl}>56 RACES PLAYED</h4>
          <h4 className={styles.statsDataEl}>ESTAR: 2000</h4>
          <h4 className={styles.statsDataEl}>28 MATCHES WON</h4>
         <h4 className={styles.statsDataEl}>NFTS: 44</h4>
        </div>
      </div>  
    </>
  );
}

export default GeneralStats;
